  render() {
    return (
      <div>
        <p>TrybeTunes</p>
        <BrowserRouter>
          <Route exact path="/" component={ Login } />
          <Route exact path="/"/>
        </BrowserRouter>
      </div>
    );
  }
}

export default App;
